// src/App.jsx
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './components/Home/Home';
import CasualPage from './components/Casual/CasualPage';
import ProfessionalPage from './components/Professional/ProfessionalPage';
import './App.css';
import NavbarCasual from './components/NavBar/NavbarCasual';
import NavbarProfessional from './components/NavBar/NavbarProfessional';
import Portfolio from './components/Portfolio/Portfolio';
import Services from './components/Services/Services';
import Skills from './components/Skills/Skills';
import Contact from './components/Contact/Contact';
import Resume from './components/Resume/Resume';
import AboutMe from './components/AboutMe/AboutMe';

const App = () => {
  return (
    <Router>
      <div>
        {/* Conditionally render the Navbar based on the route */}
        <Routes>
          <Route path="/:navbarType/*" element={<AppNavbar />} />
        </Routes>

        {/* Define your other routes */}
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/casual" element={<CasualPage />} />
          <Route path="/professional" element={<ProfessionalPage />} />
          <Route path="/:navbarType/Portfolio/*" element={<AppPortfolio />} />
          {/* ... other routes */}
        </Routes>
      </div>
    </Router>
  );
};

const AppNavbar = () => {
  // Extract the navbarType from the route
  const { navbarType } = useParams();

  // Render the appropriate navbar based on navbarType
  return navbarType === 'casual' ? <NavbarCasual /> : <NavbarProfessional />;
};

const AppPortfolio = () => {
  // Extract the navbarType from the route
  const { navbarType } = useParams();

  // Render the appropriate portfolio based on navbarType
  return <Portfolio navbarType={navbarType} />;
};

export default App;
